import * as FaIcons from "react-icons/fa";

export const SidebarData = [
  {
    id: 1,
    title: "Home",
    cName: "sidebar-item",
    icon: <FaIcons.FaHome />,
    path: "/",
  },
  {
    id: 2,
    title: "",
    cName: "sidebar-item",
    icon: <FaIcons.FaCartPlus />,
    path: "/Blogs",
  },
  {
    id: 3,
    title: "Carrer",
    cName: "sidebar-item",
    icon: <FaIcons.FaEnvelopeOpenText />,
    path: "/Carrer",
  },
];
